import {buildQueryUrl} from './common'
export const getAllClients = () => {
    //get all client from 
    return [
        {   
            params: {
                client: 'casey'
            }
        },
        {   
            params: {
                client: 'brisbane'
            }
        },
    ]
}

export const getClientData = (client: string) => {
    const data = buildQueryUrl(client)
    return data
}
